import React from 'react';
import './FAQ.css';

const FAQ = () => {
  return (
    <div className="faq-container">
      <h1>Frequently Asked Questions</h1>
      <div className="faq-item">
        <h3>What is Big Commerce?</h3>
        <p>An online platform where you can buy a variety of products securely.</p>
      </div>
      <div className="faq-item">
        <h3>How do I track my order?</h3>
        <p>You can track your orders in your account dashboard under "Orders".</p>
      </div>
    </div>
  );
};

export default FAQ;
